link.script:
var current = location.href;
if (current.indexOf('/HappierWithAvion') >= 0 ) {
    location.href = 'http://www.rbc.com/happierwithavion/index.html';
}
if (current.indexOf('/BusinessOffer') >= 0 ) {
    location.href = 'http://www.rbc.com/businessoffer/';
}
if (current.indexOf('/YourMoney') >= 0 ) {
    location.href = 'https://www.rbcroyalbank.com/dms/investments/wymut/2018-winter-d.html?utm_source=vanity&utm_medium=cpm&utm_campaign=di_winter%20investment%20-%20wis&utm_content=rbc.com%2fyourmoney';
}
if (current.indexOf('/Avion') >= 0 ) {
    location.href = 'http://www.rbc.com/avion/';
}
if (current.indexOf('/VERYHAPPY') >= 0 ) {
    location.href = 'http://www.rbc.com/aboutus/';
}
if (current.indexOf('/CORPORATECARDSERVICES') >= 0 ) {
    location.href = 'http://www.rbcroyalbank.com/commercial/campaign/commercial-cards/pa/index.html';
}

